import React, {Component} from 'react';

class Timer extends Component{
    constructor(props) {
       super(props);
       this.state = {
          start: 'start',
          num: 0
       }
    }

    render(){
          <div>
              <h1>倒计时</h1>
              <h2>{this.state.num}</h2>
              <button>{this.state.start}</button>
              <button>clear</button>
          </div>
    }
}

export default Timer;
